// /components/ResumeProjectsSection.js
import React from "react";
import Button from "./Buttons";

function ResumeProjectsSection() {
  const handleResumeClick = () => {
    // Insert logic or link for viewing your resume, e.g.:
    window.open("https://example.com/resume.pdf", "_blank");
  };

  const handleFTCClick = () => {
    // Insert logic to view a video of your FTC robotics project
    window.open("https://example.com/ftc_robotics_video", "_blank");
  };

  const handleDayTravelMapClick = () => {
    // Insert logic to view your Day Travel Map project
    window.open("https://example.com/day_travel_map", "_blank");
  };

  return (
    <section className="container my-4">
      <div className="row text-center">
        <div className="col-md-4">
          <h3>Resume</h3>
          <Button onClick={handleResumeClick}>View Resume</Button>
        </div>
        <div className="col-md-4">
          <h3>FTC Robotics</h3>
          <Button onClick={handleFTCClick}>View Video</Button>
        </div>
        <div className="col-md-4">
          <h3>Day Travel Map</h3>
          <Button onClick={handleDayTravelMapClick}>View Project</Button>
        </div>
      </div>
    </section>
  );
}

export default ResumeProjectsSection;
